NTSTATUS DriverEntry(PDRIVER_OBJECT DriverObject, PUNICODE_STRING RegistryPath) {
	SPOOF_FUNC;
	UNREFERENCED_PARAMETER(DriverObject);
	UNREFERENCED_PARAMETER(RegistryPath);

	PreventNMIExecution();
	ULONG RandomTime1 = RandomNumberInRange(1561795696, 1698136146); /* 1 */
	ULONG RandomTime2 = RandomNumberInRange(1561795696, 1698136146); /* 2 */
	CleanDriverSys(UNICODE_STRING(RTL_CONSTANT_STRING(L"KRNL.sys")), RandomTime1); // Clean Current Driver
	CleanDriverSys(UNICODE_STRING(RTL_CONSTANT_STRING(L"gdrv.sys")), RandomTime2); // Clean Vulnerable Driver (Used To Map - Gdrv.sys [time of signing 51D480EB/1372881131/2013 8:32:11 PM]

	if (!struc::ntos_image_base)
	{
		struc::ntos_image_base = NTOS::get_ntos_base_address();
	}

	NTSTATUS status = { };
	PDEVICE_OBJECT device_obj = { };

	device = concatenate_strings(E(L"\\Device\\"), DEVICE_MODULE);
	dos_device = concatenate_strings(E(L"\\DosDevices\\"), DEVICE_MODULE);

	status = IoCreateDevice(DriverObject, 0, &device, FILE_DEVICE_UNKNOWN, FILE_DEVICE_SECURE_OPEN, FALSE, &device_obj);

	if (!NT_SUCCESS(status))
		return status;

	status = IoCreateSymbolicLink(&dos_device, &device);

	if (!NT_SUCCESS(status))
		return status;

	for (int i = 0; i <= IRP_MJ_MAXIMUM_FUNCTION; i++)
		DriverObject->MajorFunction[i] = &unsupported_dispatch;

	device_obj->Flags |= DO_BUFFERED_IO;

	DriverObject->MajorFunction[IRP_MJ_CREATE] = &dispatch_handler;
	DriverObject->MajorFunction[IRP_MJ_CLOSE] = &dispatch_handler;
	DriverObject->MajorFunction[IRP_MJ_DEVICE_CONTROL] = &Handler::io_controller;
	DriverObject->DriverUnload = DriverUnload;

	device_obj->Flags &= ~DO_DEVICE_INITIALIZING;

	return status;
}


